description:
[MommysGirl] 2015-04-25 Cherie DeVille &amp; Alina West [Never Too Small][SD] [.mp4]

Alina needed some time to herself today, venting in her diary about the fight she had with her step mom Cherie. Alina is somewhat frustrated that her mom spends all her time in the kitchen preparing food. Having a mom cooking food for the family shouldn't be an issue, but Alina explains that Cherie's obsession with cooking has taken priority over quality time with Alina and her father. Alina thinks it's time to step up and advocate that her mom needs to pay more attention to her than her cooking, no matter what it takes...

